export const Clock = (props: {
  hour: Accessor<number>;
  min: Accessor<number>;
  ui: {
    face: {
      stroke: string;
      strokeWidth: number;
      fill?: string;
    };
    min: { stroke: string; strokeWidth: number };
    hour: { stroke: string; strokeWidth: number };
    centre: { fill: string };
  };
}) => {
  // const mTheta = (props.min() * Math.PI) / 60
  const hTheta = () => (((props.hour() % 12) + props.min() / 60) * 360) / 12;
  const mTheta = () => (props.min() * 360) / 60;
  // createEffect(() =>
  //     console.log(
  //         `h(${hTheta}) m(${mTheta}) hour:${props.hour()} min:${props.min()}`,
  //     ),
  // )
  return (
    <div class="w-full h-full">
      <svg
        viewBox="0 0 100 100"
        stroke-linecap="round"
        stroke-linejoin="round"
      >
        <g>
          <circle
            r="45"
            cx="50"
            cy="50"
            stroke={props.ui.face.stroke}
            stroke-width={props.ui.face.strokeWidth}
            fill={props.ui.face?.fill || "transparent"}
          />
          <circle
            r="7"
            cx="50"
            cy="50"
            stroke-width={0}
            fill={props.ui.centre.fill}
          />
          {/* <line x1="50" y1="50" x2={x2min()} y2={y2min()} /> */}
          <line
            x1="50"
            y1="50"
            x2="50"
            y2="15"
            transform={`rotate(${mTheta()},50,50)`}
            stroke={props.ui.min.stroke}
            stroke-width={props.ui.min.strokeWidth}
          />
          <line
            x1="50"
            y1="50"
            x2="50"
            y2="28"
            stroke={props.ui.hour.stroke}
            stroke-width={props.ui.hour.strokeWidth}
            transform={`rotate(${hTheta()},50,50)`}
          />
        </g>
      </svg>
    </div>
  );
};

const isDaylight = (h: number) => h >= 6 && h < 18;

export const DefaultDarkClock = (props: {
  hour: Accessor<number>;
  min: Accessor<number>;
  faceColors?: { day: string; night: string };
  hourHandColors?: { day: string; night: string };
  minHandColors?: { day: string; night: string };
  borderColors?: { day: string; night: string };
}) => {
  const faceFill = () =>
    !isDaylight(props.hour())
      ? props.faceColors
        ? props.faceColors.night
        : "#000000C0"
      : props.faceColors
        ? props.faceColors.day
        : "#eee";
  const minStroke = () =>
    !isDaylight(props.hour())
      ? props.minHandColors
        ? props.minHandColors.night
        : "#7bdcdc"
      : props.minHandColors
        ? props.minHandColors.day
        : "#004080";
  const hourStroke = () =>
    !isDaylight(props.hour())
      ? props.hourHandColors
        ? props.hourHandColors.night
        : "aqua"
      : props.hourHandColors
        ? props.hourHandColors.day
        : "#004080";
  const borderStroke = () =>
    !isDaylight(props.hour())
      ? props.borderColors
        ? props.borderColors.night
        : "#80808080"
      : "#000000D0";
  return (
    <Clock
      hour={props.hour}
      min={props.min}
      ui={{
        face: {
          stroke: borderStroke(),
          strokeWidth: 7,
          fill: faceFill(),
        },
        min: { stroke: minStroke(), strokeWidth: 6 },
        hour: { stroke: hourStroke(), strokeWidth: 8.5 },
        centre: { fill: borderStroke() },
      }}
    />
  );
};

